import React, { Component } from 'react';
import './CompareCompany.css';
import Card from 'react-bootstrap/Card';
import {Button,Form} from 'react-bootstrap';
import NavWithDropDownUser from '../UserNavBar';


class CompareCompany extends Component{
    constructor(props){
        super(props);
        this.state = {
            data : [],
            exchangeData : []
        }
        this.generateMap = this.generateMap.bind(this);
    }

    componentDidMount(){
        console.log("token" + this.props.getAuthToken());
        var requestOptions = {
            method : 'GET',
            headers : {"Authorization" : "Bearer " + this.props.getAuthToken() }
        }

        Promise.all([
            fetch("http://localhost:8082/company/getCompanies",requestOptions),
            fetch("http://localhost:8084/stockexchange/getNames",requestOptions)
        ])
        .then(([res1,res2]) => {
            return Promise.all([res1.json(),res2.json()])
        })
        .then(([res1,res2]) => {
            this.setState({
                data : res1,
                exchangeData : res2
            })
        })
    }

    generateMap(){

    }

    render(){
        return(
            <React.Fragment>
                <NavWithDropDownUser />
                <br></br>
                <br></br>
                <br></br>
                <div id="compare-main-div">
                <Card id="select-form-cc">
                <Card.Header>Compare Companies and Sectors</Card.Header>
                <Card.Body>
                    
                    <Form onSubmit={this.generateMap}>
                        <Form.Group>
                            <Form.Label>Select Company/Sector</Form.Label>
                            <select name="type" id="type">
                                <option key="company" value="company">Company</option>
                                <option key="sector" value="sector">Sector</option>
                            </select>
                        </Form.Group>
                        <Form.Group>
                            <Form.Label>Select a Company</Form.Label>
                            <select name="company" id="company">
                            {this.state.data.map(company => (
                            <option key={company} value={company}>
                                {company}
                            </option>
                            ))}
                            </select>
                        </Form.Group>

                        <Form.Group>
                            <Form.Label>Select Stock Exchange</Form.Label>
                            <select name="exchange" id="exchange">
                            {this.state.exchangeData.map(exchange => (
                            <option key={exchange} value={exchange}>
                                {exchange}
                            </option>
                            ))}
                            </select>
                        </Form.Group>
 
                        
                        <Button variant="primary" type="submit">
                            {this.props.type}
                        </Button>
                        
                    </Form>
                       
                </Card.Body>
            
                </Card>
                </div>
            </React.Fragment>
            
        );
    }
}

export default CompareCompany;
